"original": |2-
     Each parameter in a SETTINGS frame replaces any existing value for
     that parameter.  Settings are processed in the order in which they
     appear, and a receiver of a SETTINGS frame does not need to maintain
     any state other than the current value of each setting.  Therefore,
     the value of a SETTINGS parameter is the last value that is seen by a
     receiver.
"fixed": |-
  Each parameter in a SETTINGS frame replaces any existing value for that parameter.  Settings are processed in the order in which they appear, and a receiver of a SETTINGS frame does not need to maintain any state other than the current value of each setting.  Therefore, the value of a SETTINGS parameter is the last value that is seen by a receiver.
"ko": |-
  SETTINGS 프레임의 각 매개변수는 해당 매개변수의 기존 값을 대체합니다. 설정은 나타나는 순서대로 처리되며 SETTINGS 프레임의 수신자는 각 설정의 현재 값 이외의 상태를 유지할 필요가 없습니다. 따라서 SETTINGS 매개변수의 값은 수신기에 표시되는 마지막 값입니다.
